import React from "react";

function CuisinesofIndia() {
  return (
    <Container className="fredom-arch-header">
      <Row>
        <Col>
          <h1>Cuisines of India</h1>
        </Col>
      </Row>
    </Container>
  );
}

export default CuisinesofIndia;
